import React from 'react';

const MaPresentationPersonnelle = () => {
  return (
    <div className="presentation-container">
      <h2>A propos de moi</h2>
      <div className="info-section">
        <p><strong>Mon nom: </strong>[DJUIKOUO BRINDA]</p>
         <p><strong>j'ai </strong>[18] ans</p>
          <p><strong>je vis à </strong>[yaoundé]</p>

           <h3>Mes matières préférées :</h3>
           <ul>
           <li>Informatique</li>
           <li>Physique</li>
           <li>Mathématiques</li>
           </ul>
           <p className="motivation"></p>
           <em>J'apprends React parce que c'est une technologie moderne qui me permettra de créer des interfaces utilisateur interactives et de développer ma carrière en développement web.</em>
      </div>
    </div>
  );
};
export default MaPresentationPersonnelle;
